import { useEffect, useState } from "react";
import { Navigate } from "react-router-dom";
import door from '../images/door.png';
import validate from '../services/validateToken';

const Moria = ({token}) => {
    //implement token axios post request
    const [userDetails,setuserDetails] = useState();
    const tokenString = localStorage.getItem('token');
    const userToken = JSON.parse(tokenString);    

    useEffect(() => {
        const fetchData = async () => {
            const userData = await validate(userToken);
            console.log(userData)
            setuserDetails(userData);
        };
        fetchData();
    }, []);

    return (
        <div>
        <div className=" flex w-full justify-center items-center  bg-gradient-to-r from-slate-500 to-blue-900">
        <h1 className="italic text-3xl sm:text-5xl text-white text-gradient  py-4">
            Well done Traveler {userDetails}!
        </h1>
        </div>
        <div  className=" flex w-full justify-center items-center  bg-gradient-to-r from-slate-500 to-blue-900">
            <div className="relative  basis-1/2 p-1 w-22 h-22">
                <img src={door}  alt="" className="w-23 cursor-pointer"/>
            </div>
        </div>
        </div>
    )
};

export default Moria;
